import styled from 'styled-components';
import Portfolio from './../Portfolio/Portfolio';
export const Allocation = styled.div`
color:#303030;
font-size:16px;
`;
export const Perform_heading = styled.div`
color:navy;
font-size:32px;
margin:10px 0px;
`;
export const Portfoli = styled.div`
color:#303030;
font-size:16px;
`;
